using namespace std;
int largerOne(long long sumX, long long sumY, int xi, int yi, long long powerX,
              long long powerY) {
  if (xi * powerX + sumX > (yi + 1) * powerY + sumY)
    return 1;
  else if (yi * powerY + sumY > (xi + 1) * powerX + sumX)
    return 2;
  else
    return 0;
}
int main() {
  int n, m, bx, by;
  vector<int> X, Y;
  long long powerX = 1, powerY = 1;
  bool xLarger = false, yLarger = false;
  istream &input = cin;
  input >> n >> bx;
  for (int i = 0; i < n; i++) {
    int a;
    input >> a;
    X.push_back(a);
    powerX *= bx;
  }
  powerX /= bx;
  input >> m >> by;
  for (int i = 0; i < m; i++) {
    int a;
    input >> a;
    Y.push_back(a);
    powerY *= by;
  }
  powerY /= by;
  int l = min(n, m);
  long long sumX = 0, sumY = 0;
  for (int i = 0; i < l; i++) {
    int xi = X[i], yi = Y[i];
    int res = largerOne(sumX, sumY, xi, yi, powerX, powerY);
    if (res == 0) {
      sumX += powerX * xi;
      sumY += powerY * yi;
      powerX /= bx, powerY /= by;
    } else if (res == 1) {
      xLarger = true;
      break;
    } else if (res == 2) {
      yLarger = true;
      break;
    } else {
      assert(false);
    }
  }
  if (xLarger) {
    cout << '>' << endl;
    return 0;
  } else if (yLarger) {
    cout << '<' << endl;
    return 0;
  } else if (n == m) {
    if (sumX > sumY)
      cout << '>' << endl;
    else if (sumX < sumY)
      cout << '<' << endl;
    else
      cout << '=' << endl;
    return 0;
  }
  vector<int> &Z = n > m ? X : Y;
  long long sumZ = n > m ? sumX : sumY;
  long long sumShort = n > m ? sumY : sumX;
  long long powerZ = n > m ? powerX : powerY;
  long long bz = n > m ? bx : by;
  bool larger = false;
  for (int i = l; i < max(n, m); i++) {
    int zi = Z[i];
    sumZ += zi * powerZ;
    if (sumZ > sumShort) {
      larger = true;
      break;
    }
    powerZ /= bz;
  }
  if (larger) {
    cout << (n > m ? '>' : '<') << endl;
  } else {
    if (sumZ > sumShort) cout << '>' << endl;
    if (sumZ == sumShort)
      cout << '=' << endl;
    else if (sumZ < sumShort)
      cout << (n > m ? '<' : '>') << endl;
    else
      assert(false);
  }
  return 0;
}

