import java.util.Scanner;

public class A {

	public static void main(String[] args) {

		try(Scanner input = new Scanner(System.in)) {
			long X = read(input);
			long Y = read(input);
			if (X < Y)
				System.out.println("<");
			else if (X == Y)
				System.out.println("=");
			else 
				System.out.println(">");
		}
	}

	private static long read(Scanner input) {
		int nx = input.nextInt();
		int bx = input.nextInt();

		long X = 0;
		long xp = pow(bx, nx - 1);
		for(int i = 0; i < nx - 1; i++) {
			X += xp*input.nextInt();
			xp /= bx;
		}
		X += input.nextInt();
		return X;
	}

	private static long pow(int x, int n) {
		if (n == 0) 
			return 1;
		long r = 1;
		for(int i = 1; i <= n; i++)
			r *= x;

		return r;

	}
}

import sys

class Scanner:

    def __init__(self):
        self.current_tokens = []

    def remaining_tokens(self):
        return len(self.current_tokens)

    def nextline(self):
        assert self.remaining_tokens() == 0, "Reading next line with remaining tokens"
        return input()

    def nexttokens(self):
        return self.nextline().split()

    def nexttoken(self):
        if len(self.current_tokens) == 0:
            self.current_tokens = self.nexttokens()
        assert self.remaining_tokens() > 0, "Not enough tokens to parse."
        return self.current_tokens.pop(0)

    def nextints(self, n=-1):
        if n == -1:
            return list(map(int, self.nexttokens()))
        else:
            return [self.nextint() for i in range(n)]

    def nextint(self):
        return int(self.nexttoken())

def quit():
