import java.io.InputStream;
import java.io.PrintWriter;
import java.util.InputMismatchException;



public class Main {
	public static void main(String args[]) {
		InputReader in = new InputReader(System.in);
		PrintWriter pw = new PrintWriter(System.out);
		int n=in.nextInt();
		int bx=in.nextInt();
		long ansx=0,ansy=0;
		long pow=(long)Math.pow(bx, n-1);
		for(int i=n-1;i>=0;i--){
			int num=in.nextInt();
			ansx=ansx+(num*pow);
			pow/=bx;
		}
		int m=in.nextInt();
		int by=in.nextInt();
		pow=(long)Math.pow(by, m-1);
		for(int i=m-1;i>=0;i--){
			int num=in.nextInt();
			ansy=ansy+(num*pow);
			pow/=by;
		}
		//System.out.println(ansx+" "+ansy);
		if(ansx==ansy)
			pw.println("=");
		else if(ansx>ansy)
			pw.println(">");
		else
			pw.println("<");
		pw.close();

	}
	static class InputReader { 
		private InputStream stream;
		private byte[] buf = new byte[8192];
		private int curChar;
		private int snumChars;

		public InputReader(InputStream stream) {
			this.stream = stream;
		}

		public int snext() {
			if (snumChars == -1)
				throw new InputMismatchException();
			if (curChar >= snumChars) {
				curChar = 0;
				try {
					snumChars = stream.read(buf);
				} catch (IOException e) {
					throw new InputMismatchException();
				}
				if (snumChars <= 0)
					return -1;
			}
			return buf[curChar++];
		}

		public int nextInt() {
			int c = snext();
			while (isSpaceChar(c))
				c = snext();
			int sgn = 1;
			if (c == '-') {
				sgn = -1;
				c = snext();
			}

			int res = 0;

			do {
				if (c < '0' || c > '9')
					throw new InputMismatchException();
				res *= 10;
				res += c - '0';
				c = snext();
			} while (!isSpaceChar(c));

			return res * sgn;
