class TaskA {
    public void solve(int testNumber, InputReader in, PrintWriter out) {
        long val1 = read(in);
        long val2 = read(in);

        if (val1 == val2){
            out.println("=");
        } else if (val1 < val2){
            out.println("<");
        } else {
            out.println(">");
        }
    }

    private long read(InputReader in) {
        int n = in.nextInt();
        long base = in.nextLong();

        long mult = 1;

        for (int i=0; i<n-1; i++){
            mult *= base;
        }

        long sol = 0;

        for (int i=0; i<n; i++){
            long val = in.nextLong();

            sol = sol + val * mult;

            mult = mult / base;
        }

        return sol;
    }
}

