		int digits2 = sc.nextInt(), base2 = sc.nextInt();
		int[] number2 = new int[digits2];
		for(int i = 0; i<digits2; i++) number2[i] = sc.nextInt();

		long b1 = changeBaseToTen(number1, base1);
		long b2 = changeBaseToTen(number2, base2);
		out.println(b1 == b2 ? "=" : b1 < b2 ? "<" : ">");
		out.close();
