	public static long changeBaseToTen(int[] l, int base) {
		if (l.length == 0 || l.length == 1 && l[0] == 0)
			return 0;
		int neg = 1;
		if (l[0] < 0) {
			neg = -1;
			l[0] = l[0] * -1;
		}
		long value = 0;
		for(int i = 0; i<l.length; i++){
			value+=l[l.length-1-i]*Math.pow(base, i);
		}
		return value;
	}



