            System.out.print(">");
        } else {
            System.out.print("<");
        }

    }

    public static double toDec(int[] array, int base) {
        double decnum = 0;
        for (int i = 0; i < array.length; i++) {
            decnum += array[i] * Math.pow((double) base, (double) array.length - i - 1);
        }
        return decnum;
    }

}

