class Solution {
    IOUtils io;

    public Solution(IOUtils io) throws Exception {
        this.io = io;

        int n = io.readInt();
        int bx = io.readInt();

        long x = 0;
        for (int i = 0; i < n; i++) {
            x = bx * x + io.readInt();
        }

        int m = io.readInt();
        int by = io.readInt();

        long y = 0;
        for (int i = 0; i < m; i++) {
            y = by * y + io.readInt();
        }

        if (x < y) io.writeln("<");
        else if (x > y) io.writeln(">");
        else io.writeln("=");
    }
}

