    public static long read(QuickScanner sc) {
        int n = sc.nextInt();
        int b = sc.nextInt();

        String next = sc.nextLine();
        String[] digits = next.split(" ");
        long result = 0;
        long t = 1;
        for (int i = digits.length - 1; i >= 0; i--) {
            result += Integer.parseInt(digits[i]) * t;
            t *= b;
        }
        return result;
    }

    private static class QuickScanner {
        BufferedReader in;
        StringTokenizer token;

        public QuickScanner() {
            this.in=new BufferedReader(new InputStreamReader(System.in));
            this.token=new StringTokenizer(""," \n\t");
        }

        public boolean hasNext() {
            while(!token.hasMoreTokens()) {
                try {
                    String s=in.readLine();
                    if(s==null) return false;
                    token=new StringTokenizer(s," \n\t");
                } catch (IOException e) {
                    throw new InputMismatchException();
                }
            }
            return true;
        }

        public String nextLine() {
            try {
                return in.readLine();
            } catch (IOException e) {
                throw new InputMismatchException();
            }
        }

        public String next() {
            hasNext();
            return token.nextToken();
        }

        public int nextInt() {
            return Integer.parseInt(next());
        }
    }
