public class ProblemA{

    char solve(int[] a, int ba, int[] b, int bb){
        long ansa = 0, ansb = 0;
        long exp = 1;
        for (int i = a.length - 1; i >= 0; i--){
            ansa += a[i] * exp;
            exp *= ba;
        }
        exp = 1;
        for (int i = b.length - 1; i >= 0; i--){
            ansb += b[i] * exp;
            exp *= bb;
        }
        return ansa < ansb ? '<' : ansa > ansb ? '>' : '=';
    }

