public class Main {
    Scanner sc = new Scanner(System.in);

    public static void main(String[] args) {
        new Main(); 
    }

    public Main() {
        new A().doIt();
    }
    class A{
        BigInteger bigcnt(int n,String num[],BigInteger a){
            BigInteger result = new BigInteger("0");
            BigInteger dice = new BigInteger("1");
            for(int i = 0;i < n;i++){
                BigInteger pos = new BigInteger(num[n-i-1]);
                result = result.add(dice.multiply(pos));
                dice = dice.multiply(a);
            }
            return result;
        }
        void doIt(){
            int n = sc.nextInt();
            String a = sc.next();
            String numa[] = new String [n];
            for(int i = 0;i < n;i++)numa[i] = sc.next();
            int m = sc.nextInt();
            String b = sc.next();
            String numb[] = new String [m];
            for(int i = 0;i < m;i++)numb[i] = sc.next();
            BigInteger ba = new BigInteger("0");
            BigInteger bb = new BigInteger("0");
            ba = bigcnt(n,numa,new BigInteger(a));
            bb = bigcnt(m,numb,new BigInteger(b));
            ba = ba.subtract(bb);
            String str = ba.toString();
            char ctr[] = str.toCharArray();
            if(ctr[0] == '0')System.out.println("=");
            else if(ctr[0] == '-')System.out.println("<");
            else System.out.println(">");
        }
    }
}

