    public void solve(BufferedReader in, PrintWriter out)
    {
        try
        {
            String tokens[] = in.readLine().split(" ");
            int baseX = Integer.parseInt(tokens[1]);
            String x[] = in.readLine().split(" ");

            tokens = in.readLine().split(" ");
            int baseY = Integer.parseInt(tokens[1]);
            String y[] = in.readLine().split(" ");

            out.println(taskA(x, baseX, y, baseY));
        } catch (IOException e)
        {
            e.printStackTrace();
        }
    }

    public char taskA(String x[], int baseX, String y[], int baseY)
    {
        long tempX = 0;
        for (int i = x.length - 1, count = 0; i >= 0; i--, count++)
        {
            tempX += Integer.parseInt(x[i]) * power(baseX, count);
        }
        long tempY = 0;
        for (int i = y.length - 1, count = 0; i >= 0; i--, count++)
        {
            tempY += Integer.parseInt(y[i]) * power(baseY, count);
        }
        if (tempX > tempY)
        {
            return '>';
        }
        else if (tempX < tempY)
        {
            return '<';
        }
        return '=';
    }

    public long power(int base, int exp)
    {
        long temp = 1;
        for (int i = 1; i <= exp; i++)
        {
            temp *= base;
        }
        return temp;
    }
}

