	public static double calculate(int count, double base, String[] value){
		double result = 0.0;
		for (int i = 0; i < count; ++i) {
			double v = Math.pow(base, Math.abs(count-1-i));
			double s = Double.valueOf(value[i]);
			if (value[i].length() > 1) {
				s = (Double.valueOf(value[i].charAt(0)) - 48) * 10 + (Double.valueOf(value[i].charAt(1)) - 48);
			}
			result += s * v;
		}
		return result;
	}
