public class Problem602A {
    public static void main(String[] args) {
        FastScanner scanner = new FastScanner();
        int n = scanner.nextInt();
        int bx = scanner.nextInt();
        int[] x = new int[n];
        for (int i = 0; i < n; i++) {
            x[i] = scanner.nextInt();
        }

        int m = scanner.nextInt();
        int by = scanner.nextInt();
        int[] y = new int[m];
        for (int i = 0; i < m; i++) {
            y[i] = scanner.nextInt();
        }

        long decimalX = getDecimalRepresentation(x, bx);
        long decimalY = getDecimalRepresentation(y, by);
        if (decimalX < decimalY) {
            System.out.println('<');
        } else if (decimalX > decimalY) {
            System.out.println('>');
        } else {
            System.out.println('=');
        }
    }

    private static long getDecimalRepresentation(int[] number, int base) {
        long result = 0;
        int length = number.length - 1;
        for (int i = 0; i < length + 1; i++) {
            result += number[i] * Math.pow(base, length - i);
        }
        return result;
    }

    private static class FastScanner {
        BufferedReader br;
        StringTokenizer st;

        public FastScanner() {
            br = new BufferedReader(new InputStreamReader(System.in));
        }

        String next() {
            while (st == null || !st.hasMoreElements()) {
                try {
                    st = new StringTokenizer(br.readLine());
                } catch (IOException e) {
                    e.printStackTrace();
                }
            }
            return st.nextToken();
        }

        int nextInt() {
            return Integer.parseInt(next());
        }

        long nextLong() {
            return Long.parseLong(next());
        }

        double nextDouble() {
            return Double.parseDouble(next());
        }

        short nextShort() {
            return Short.parseShort(next());
        }

        byte nextByte() {
            return Byte.parseByte(next());
        }

        String nextLine() {
            String str = "";
            try {
                str = br.readLine();
            } catch (IOException e) {
                e.printStackTrace();
            }
            return str;
        }

    }
}

