    public long ConvertToDecimal(int ar[], int base){
        long res=0;
        for(int i=0,j=ar.length-1;i<ar.length;i++,j--){
            long val = (long)(ar[j]*Math.pow(base,i));
            res+=val;
        }
        return res;
    }
}

