   BigInteger calc(String base, String[] digits) {
       int n = digits.length;
       BigInteger result = new BigInteger("0");
       BigInteger b = new BigInteger(base);
       for (int i = 0; i <= digits.length - 1; i++) {
           result = result.add(b.pow(n - 1 - i).multiply(new BigInteger(digits[i])));
       }

       return result;
   }
}

