public class Main {

    public static BigInteger getBigInt(int bx, List<Integer> value) {
        BigInteger bigInteger = BigInteger.valueOf(0);
        BigInteger degree = BigInteger.valueOf(1);

        for (int i = 0; i < value.size(); ++i) {
            BigInteger k = BigInteger.valueOf(value.get(value.size() - i - 1));
            k = k.multiply(degree);
            bigInteger = bigInteger.add(k);

            degree = degree.multiply(BigInteger.valueOf(bx));
        }

        return bigInteger;
    }

