int bigPow(int a, int b, int m) {
  if (b == 1) return a % m;
  if (b == 0) return 1;
  long long res = bigPow(a, b / 2, m);
  res = (res * res) % (long long)m;
  if (b % 2) res = (res * a % m) % m;
  return res;
}
