int nod(int n) {
  if (n == 1) return 1;
  int lim = sqrt(n);
  int gun = 1;
  for (int i = 2; i <= lim; i++) {
    if (n % i) continue;
    int c = 0;
    while (n % i == 0) {
      c++;
      n /= i;
    }
    gun *= (c + 1);
  }
  if (n != 1) gun *= 2;
  return gun;
}
long long sod(int n) {
  if (n == 1) return 1;
  int lim = sqrt(n);
  long long gun = 1;
  for (int i = 2; i <= lim; i++) {
    if (n % i) continue;
    long long temp = i;
    while (n % temp == 0) {
      temp *= i;
    }
    n /= (temp / i);
    gun *= (temp - 1) / (i - 1);
  }
  if (n != 1) gun *= n + 1;
  return gun;
}
