import java.math.BigDecimal;
import java.util.Scanner;

public class Main {


    static BigDecimal pow(double n, int pow) {

        if (pow == 0) {
            return BigDecimal.ONE;
        }
        if (pow % 2 == 0) {
            BigDecimal k = pow(n, (pow / 2));
            return k.multiply(k);
        } else {
            BigDecimal k = pow(n, ((int) Math.ceil(pow / 2)));
            return k.multiply(k).multiply(new BigDecimal(n));
        }

    }

    public static void main(String[] args) {
        Scanner in = new Scanner(System.in);
        BigDecimal n1;
        BigDecimal n2;
        while (in.hasNext()) {
            int n = in.nextInt();
            int baseX = in.nextInt();
            n1 = BigDecimal.ZERO;
            n2 = BigDecimal.ZERO;

            for (int i = 0; i < n; i++) {
                BigDecimal b = new BigDecimal(in.nextInt());
                b=b.multiply(pow(baseX, (n - i - 1)));
                n1=n1.add(b);
            }
            int m = in.nextInt();
            int baseY = in.nextInt();
            for (int i = 0; i < m; i++) {
                BigDecimal b = new BigDecimal(in.nextInt());
                b=b.multiply(pow(baseY, (m - i - 1)));
                n2=n2.add(b);
            }
            switch (n1.compareTo(n2)) {
                case 0:
                    System.out.println("=");
                    break;
                case 1:
                    System.out.println(">");
                    break;
                case -1:
                    System.out.println("<");
                    break;
            }
        }
    }
}

