public class Main{
	public static void main(String[] args){
		InputStream inputStream = System.in;
		OutputStream outputStream = System.out;
		InputReader in = new InputReader(inputStream);
		OutputWriter out = new OutputWriter(outputStream);
		TaskA solver = new TaskA();
		solver.solve(1, in, out);
		out.close();
	}
	static class TaskA{
		public void solve(int testNumber, InputReader in, OutputWriter out){
			int xdigits = in.ri(), xbase = in.ri();
			int[] x = IOUtils.readIntArray(in, xdigits);
			long xval = getval(x, xbase);
			int ydigits = in.ri(), ybase = in.ri();
			int[] y = IOUtils.readIntArray(in, ydigits);
			long yval = getval(y, ybase);
			if(xval > yval) out.printLine(">");
			else if(xval < yval) out.printLine("<");
			else out.printLine("=");
		}
		private long getval(int[] arr, int base){
			long res = 0;
			for(int power = 0; power < arr.length; power++) {
				int digit = arr[arr.length - power - 1];
				res += digit * IntegerUtils.power(base, power);
			}
			return res;
		}
	}
	static class IntegerUtils{
		public static long power(long base, long exponent){
			if(exponent == 0)
				return 1;
			long result = power(base, exponent >> 1);
			result = result * result;
			if((exponent & 1) != 0)
				result = result * base;
			return result;
		}
	}
	static class InputReader{
		private InputStream stream;
		private byte[] buf = new byte[1024];
		private int curChar;
		private int numChars;
		private SpaceCharFilter filter;
		public InputReader(InputStream stream){
			this.stream = stream;
		}
		public int read(){
			if(numChars == -1)
				throw new InputMismatchException();
			if(curChar >= numChars){
				curChar = 0;
				try{
					numChars = stream.read(buf);
				} catch(IOException e){
					throw new InputMismatchException();
				}
				if(numChars <= 0)
					return -1;
			}
			return buf[curChar++];
		}
		public int ri(){
			return readInt();
		}
		public int readInt(){
			int c = read();
			while(isSpaceChar(c))
				c = read();
			int sgn = 1;
			if(c == '-'){
				sgn = -1;
				c = read();
			}
			int res = 0;
			do{
				if(c < '0' || c > '9')
					throw new InputMismatchException();
				res *= 10;
				res += c - '0';
				c = read();
			} while(!isSpaceChar(c));
			return res * sgn;
		}
		public boolean isSpaceChar(int c){
			if(filter != null)
				return filter.isSpaceChar(c);
			return isWhitespace(c);
		}
		public static boolean isWhitespace(int c){
			return c == ' ' || c == '\n' || c == '\r' || c == '\t' || c == -1;
		}
		public interface SpaceCharFilter{
			public boolean isSpaceChar(int ch);
		}
	}
	static class IOUtils{
		public static int[] readIntArray(InputReader in, int size){
			int[] array = new int[size];
			for(int i = 0; i < size; i++)
				array[i] = in.readInt();
			return array;
		}
	}
	static class OutputWriter{
		private final PrintWriter writer;
		public OutputWriter(OutputStream outputStream){
			writer = new PrintWriter(new BufferedWriter(new OutputStreamWriter(outputStream)));
		}
		public OutputWriter(Writer writer){
			this.writer = new PrintWriter(writer);
		}
		public void print(Object... objects){
			for(int i = 0; i < objects.length; i++) {
				if(i != 0)
					writer.print(' ');
				writer.print(objects[i]);
			}
		}
		public void printLine(Object... objects){
			print(objects);
			writer.println();
		}
		public void close(){
			writer.close();
		}
	}
}

