public class Solution {

	static InputReader in = new InputReader(System.in);
	static OutputWriter out = new OutputWriter(System.out);
	static int mod = (int) (1e9 + 7);

	public static void main(String[] args) throws IOException {

		int x = in.nextInt();
		int bx = in.nextInt();

		BigInteger bigx = new BigInteger("0");
		BigInteger bigy = new BigInteger("0");

		for (int i = x - 1; i >= 0; i--) {
			BigInteger pow = new BigInteger(in.next()).multiply(new BigInteger(
					bx + "").pow(i));
			bigx = bigx.add(pow);
		}

		int y = in.nextInt();
		int by = in.nextInt();

		for (int i = y - 1; i >= 0; i--) {

			BigInteger pow = new BigInteger(in.next()).multiply(new BigInteger(
					by + "").pow(i));
			bigy = bigy.add(pow);
		}

		switch (bigx.compareTo(bigy)) {
		case 1:
			out.print(">");
			break;
		case -1:
			out.print("<");
			break;
		case 0:
			out.print("=");
			break;
		}

		out.close();

	}
}

