class Number:
  def __init__(self, length, base):
    self.value = []
    self.base = base
    self.length = length

  def compare(self, other):
    if(self.decimal < other.decimal): return "<"
    if(self.decimal == other.decimal): return "="
    if(self.decimal > other.decimal): return ">"

  @property
  def decimal(self):
    def decimal_generator():
      for i in xrange(self.length):
        j = self.length - (i + 1)
        x = self.value[i]
        yield x * (self.base ** j)
    return sum(decimal_generator())

