public class TwoBases
{
	public static void main(String[] args)
	{
		Scanner in = new Scanner(System.in);

		int n = in.nextInt();
		int bx = in.nextInt();

		long[] xs = new long[n];
		for(int x = 0; x < n; x++)
		{
			xs[x] = in.nextInt();
		}

		int m = in.nextInt();
		int by = in.nextInt();

		long[] ys = new long[m];
		for(int y = 0; y < m; y++)
		{
			ys[y] = in.nextInt();
		}

		long x = calc(bx, xs);
		long y = calc(by, ys);

		if(x == y)
		{
			System.out.println('=');
		}
		else if(x < y)
		{
			System.out.println('<');
		}
		else
		{
			System.out.println('>');
		}
	}

	public static long calc(int b, long[] vs)
	{
		long ret = 0;

		long pow = 1;
		for(int a = 0; a < vs.length; a++)
		{
			ret += pow * vs[vs.length - a - 1];
			pow *= b;
		}

		return ret;
	}
}

