public class TwoBases {
	public static void main(String [] args){
		Scanner input=new Scanner(System.in);
		int n=input.nextInt();
		int bx=input.nextInt();
		int arrx[]=new int[n];
		for(int i=0;i<n;i++)
			arrx[i]=input.nextInt();
		long x=turn(bx,arrx);

		int m=input.nextInt();
		int by=input.nextInt();
		int arry[]=new int[m];
		for(int i=0;i<m;i++)
			arry[i]=input.nextInt();
		long y=turn(by,arry);

		//System.out.println(x+" "+y);
		 if(x>y)
				System.out.println(">");
			else if(x<y)
				System.out.println("<");
			else
				System.out.println("="); 

	}
	public static long turn(int bx,int a[]){
		long num=0;
		long pow=1;
		for(int i=a.length-1;i>=0;i--){
			num+=a[i]*pow;
			pow*=bx;
		}
		return num;
	}
}

