public class Solution {

	public static void main(String[] args) throws IOException {
		new Solution().run();
	}

	FastScanner in;
	PrintWriter out;

	void run() throws IOException {
		in = new FastScanner(System.in);
		out = new PrintWriter(System.out, true);
		solve();
		out.close();
	}

	void solve() throws IOException {
		int n = in.nextInt();
		int bx = in.nextInt();
		int x[] = new int[n];
		for (int i = 0; i < n; i++)
			x[n - i - 1] = in.nextInt();

		int m = in.nextInt();
		int by = in.nextInt();
		int y[] = new int[m];
		for (int i = 0; i < m; i++)
			y[m - i - 1] = in.nextInt();

		BigInteger X, Y, power;

		X = new BigInteger("0");
		power = new BigInteger("1");
		for (int i = 0; i < n; i++) {
			X = X.add(power.multiply(new BigInteger(Integer.toString(x[i]))));
			power = power.multiply(new BigInteger(Integer.toString(bx)));
		}

		Y = new BigInteger("0");
		power = new BigInteger("1");
		for (int i = 0; i < m; i++) {
			Y = Y.add(power.multiply(new BigInteger(Integer.toString(y[i]))));
			power = power.multiply(new BigInteger(Integer.toString(by)));
		}

		if (X.equals(Y)) {
			out.println("=");
			System.exit(0);
		}
		if (X.compareTo(Y) < 0) {
			out.print("<");
		} else {
			out.print(">");
		}
	}

	class FastScanner {

		BufferedReader br;
		StringTokenizer st;

		FastScanner(InputStream in) {
			br = new BufferedReader(new InputStreamReader(in));
			st = null;
		}

		String next() throws IOException {
			while (st == null || !st.hasMoreTokens())
				st = new StringTokenizer(br.readLine());
			return st.nextToken();
		}

		int nextInt() throws IOException {
			return Integer.parseInt(next());
		}

	}

}

